First, we perform the operation in parentheses: \[6+5-4\times 3\div (2+1) = 6+5-4\times 3\div 3.\] Then, we perform multiplication and division, going from left to right: \begin{align*}
6+5-4\times 3\div 3 &= 6+5-12 \div 3 \\
&=6+5-4.
\end{align*} Finally, we perform addition and subtraction, going from left to right, to get our answer: \begin{align*}
6+5-4 &= 11-4 \\
&=\boxed{7}.
\end{align*}

According to the standard order of operations, division occurs before subtraction. We find that our answer is \begin{align*}
8-4 \div 2 - 1 &= 8-2-1 \\
&= 6-1 \\
&= \boxed{5}.
\end{align*}

We follow the order of operations:  \begin{align*}
92 - 45 \div (3\times 5) - 5^2 &= 92 - 45 \div 15 - 5^2 \\
&= 92 - 45\div 15 -25 \\
&= 92 - 3 - 25=89-25 = \boxed{64}.
\end{align*}

We tackle the parentheses, then the exponent, then the product, then the sum: \begin{align*}
8+6(3-8)^2 &= 8 + 6(-5)^2\\
&= 8+6\cdot 25\\
&= 8+150\\
&=\boxed{158}.
\end{align*}

Following the order of operations (compute the sum in $(4+8)^2$ before applying the exponent of $(4+8)^2$), we have \begin{align*}
(4+8)^2 + (4^2 + 8^2) &= (12)^2 + (4^2 + 8^2)\\
&= 144 + (16+64) \\
&= 144+ 80 \\
&= \boxed{224}.\end{align*}

We combine the terms with variables, and the terms without variables, and we have  \begin{align*}
3t+4-6t+7t - 4 &= (3t -6t +7t) + (4-4)\\
&=\boxed{4t}
\end{align*}

By the order of operations, we perform the multiplications before the additions and subtractions: \begin{align*}
9-8+7\times 6 +5-4\times 3+2-1 &= 9-8+42 +5-12 + 2 -1\\
&=1 + 42 +5-12 + 2-1\\
&=48-12 + 2 -1\\
&= 36 +1 = \boxed{37}.
\end{align*}

Recall that $(-a)^n=-a^n$ when $n$ is odd so we can rewrite $(-5)^5$ as $-5^5$. Because $a^m\div a^n=a^{m-n}$ for positive integers $m>n$, we get $$-5^5\div5^3=-5^{5-3} =-5^2.$$ Now we can rewrite the expression to get  \begin{align*}
(-5)^5\div5^3+3^{4}-6^{1}&=-5^2+3^4-6\\
&=-25+81-6\\
&=\boxed{50}.
\end{align*}

We set up the equation and solve for $x$: \begin{align*}
\frac{2x+3}{5}&=11\qquad\Rightarrow\\
2x+3&=55\qquad\Rightarrow\\
2x&=52\qquad\Rightarrow\\
x&=\boxed{26}.
\end{align*}

We can organize this subtraction quickly using columns as follows:   \[
\begin{array}{@{}c@{}c@{}c@{}c@{}c}
& 2 & . & 5 & 0 \\
- & 0 & . & 3 &2
\\ \cline{1-5}
& 2 & . & 1 & 8 \\
\end{array}
\]Therefore, $2.5-0.32 = \boxed{2.18}.$

Raising 42 to powers could get really messy really quickly, so let's avoid substituting immediately, and see if there is a way to simplify the expression first.

Recall that $\left( \frac{1}{x} \right)^n=\frac{1}{x^n}$, so we can rewrite $\left(\frac{1}{a}\right)^4$ as $\frac{1}{a^4}$. Thus, we have  \[\frac{1}{a^4} \cdot 2 \cdot a^4+a^{2+1-3}.\]Because multiplication is commutative, we can rearrange the terms to get  \[2 \cdot \frac{1}{a^4} \cdot a^4+a^{2+1-3}.\]Any nonzero number times its reciprocal is 1, so this can be simplified to \[2 \cdot 1 +a^{2+1-3}.\]Simplifying the numbers in the exponent of $a$, we find that it simplifies to $a^0$. Because any number to the zero power is 1, this simplifies to 1. Thus, we have \begin{align*}
2 \cdot 1 +a^{2+1-3} &=2 + a^0 \\
&=2+1 \\
&=\boxed{3}.
\end{align*}

Begin by simplifying the left side by grouping consecutive pairs of terms: $$(x-2x)+(3x-4x)+(5x-6x)+(7x-8x)+(9x-10x)=50$$ Now simplify, and solve for $x$: \begin{align*}
-x-x-x-x-x&=50\\
\Rightarrow\qquad -5x&=50\\
\Rightarrow\qquad x&=\boxed{-10}
\end{align*}

Begin by distributing on the left side: $$5x-3x+4-16x=32$$ Now, collect like terms and solve for $x$: \begin{align*}
-14x&=28\\
\Rightarrow\qquad x&=\frac{28}{-14}=\boxed{-2}
\end{align*}

\begin{align*}
\frac{\sqrt{24}}{\sqrt{30}}\div\frac{\sqrt{20}}{3\sqrt{25}}&=\frac{\sqrt{24}}{\sqrt{30}}\times \frac{3\sqrt{25}}{\sqrt{20}}\\
&=\frac{2\sqrt{6}}{\sqrt{5}\times \sqrt{6}}\times\frac{15}{2\sqrt{5}}\\
&=\boxed{3}
\end{align*}
